import React from 'react';

const person = (props) => {
    return ( 
        <div>
            <p onClick = {props.click}>My name is {props.name} and age is {props.age}</p>
            <p>{props.children}</p>
            <input type="text" value = {props.name}  onChange = { props.changed }></input>
        </div>
    );
}

export default person;
